  false,\n\t\"url\": null,\n\t\"notes\": \"The following list includes species which
  have been observed by refuge personnel and other observers since the establishment
  of Modoc NWR in 1960. A total of 246 bird species have been observed on Modoc NWR,
  including 22 accidental species.  At least 77 species have been documented as nesting
  on the refuge and 17 more are suspected  nesters. Of all the species listed, two
  are classified as Endangered and 37 are u2018Sensitive Speciesu2019  or u2018Species
  of Special Concernu2019. The latter categories are species which are classified
  by the  U.S. Fish and Wildlife Service (USFWS) and/or the California Department
  of Fish and Game  (CDFG) as species which could become federally listed as Endangered
  or Threatened in the  foreseeable future without active management and/or removal
  of threats.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
